exports=async function(a,b,c,d){const{parseContent:e}=await require("transcode/parse_content");return e(a,"div#content",{clientOptions:{...(d&&d.clientOptions),encoding:"gbk"},transformer:a=>a.replace(/^(?:\[[^\]]*])?[^<>&\s]*\w+\.\w+\.\w{2,3}[^<>&]*/,"").replace(/(?:\d+小说网)?\w+\.\w+\.\w{2,3}[^<]+$/,"")})};